import React, { useState } from 'react';
import Head from "next/head";
import Header from "../../../compornents/Header/header";
import SideBar from "../../../compornents/Character/sideBar";
import Footer from "../../../compornents/Footer/footer"

import Dualblade from "../../../style/job/dualblade.css";

const Index = () => {
    const [job, setJob] = useState('dualblade');
    const [group, setGroup] = useState('Adventurer');
    
    var background = {
        backgroundImage: `url(/images/background/${job}.png)`
    }
    return (
        <div>
            <Head>
                <title>msg.gg</title>
                <link rel="stylesheet" href="/style/header.css" />
                <link rel="stylesheet" href="/style/job/job.css" />
                <link rel="stylesheet" href={Dualblade} />
                <link
                    href="https://fonts.googleapis.com/css2?family=Noto+Sans+KR:wght@300;400;700&display=swap"
                    rel="stylesheet"
                ></link>
                <script src="/js/app.js"></script>
            </Head>
            <Header></Header>
            <div className="character">
                <div className="character__bg" style={background}></div>
                <SideBar group={group}></SideBar>
            </div>
            <Footer></Footer>
        </div>
    );
};

export default Index;
